import React from 'react';
import './searchresults.css';


class SearchResults extends React.Component {
    render () {
        return (
            <div className="SearchResults">
                <h2>Results</h2>
                {/* Add a TrackList component */}
            </div>
        )
    }
}

export default SearchResults;
